import "./Styles/App.scss";
import leftSideBar from "./components/leftSideBar.js";
import Body from "./components/Body.js";

function App() {
  return (
    <div className='App'>
      <leftSideBar className='App-SideBar' />
      <Body className='App-Body' />
    </div>
  );
}

export default App;
